import React, { Component } from 'react';
import './header.scss';
import { Link } from 'react-router-dom';
import MobileNav from '../MobileNav/MobileNav';

class Header extends Component {


render(){
  if(this.props.showNav){
    const MobileNav = <MobileNav onHideNav = {this.props.onHideNav} onOpenNav = {this.props.onOpenNav} />;
  }
  console.log(this.props.showNav)

  return(
    <div>
      {MobileNav}
      <nav className = "header">
        <div className = "header__container">
          <img className = "header__hamburger" src = "/images/hamburger.svg"/>
          <Link to={'/'}>
            <img className = "header__logo" src ="/images/logo.svg"/>
          </Link>
          <ul className = "header__menu--desktop">
            <li><Link to = {'/'}>Home</Link></li>
            <li><Link to = {'/about/1'}>About</Link></li>
          </ul>
        </div>
      </nav>
    </div>
  )
}

}

export default Header;
